uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters (controlled via JSON)
uniform float u_speed;
uniform float u_fov;
uniform float u_camera_dist;
uniform float u_complexity;
uniform float u_glow_intensity;

out vec4 fragColor;

// --- Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 3D Noise for tech texture
float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

// Folded Fractal Geometry (Menger-Sponge inspired tech structure)
float map(vec3 p) {
    // Subtle rotation over time
    p.xz *= rot(iTime * 0.1);
    p.xy *= rot(iTime * 0.05);

    float d = length(p) - 1.2; // Base sphere

    float scale = 1.0;
    for(int i = 0; i < 4; i++) {
        p = abs(p) - 0.5 * u_complexity;
        if (p.x < p.y) p.yx = p.xy;
        if (p.x < p.z) p.zx = p.xz;
        if (p.y < p.z) p.zy = p.yz;

        p.z -= 0.2 * scale;
        p.z *= 1.5;
        scale *= 1.5;

        // Carve boxy tech details
        float box = (max(p.x, max(p.y, p.z))) / scale;
        d = max(d, -box);

        // Add "wiring" grooves
        d = min(d, length(p.xy) / scale - 0.02);
    }

    return d;
}

// Calculate normals for lighting
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    // 1. Correct Aspect Ratio UVs
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // 2. Camera Setup (Orbiting Tech Core)
    float t = iTime * u_speed * 0.2;
    vec3 ro = vec3(cos(t), 0.5 * sin(t * 0.7), sin(t)) * u_camera_dist;
    vec3 ta = vec3(0.0, 0.0, 0.0);

    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0.0, 1.0, 0.0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd * u_fov + uv.x * right + uv.y * up);

    // 3. Raymarching
    float d = 0.0;
    float t_dist = 0.0;
    float glow = 0.0;
    float transparency = 0.0;

    for(int i = 0; i < 80; i++) {
        vec3 p = ro + rd * t_dist;
        d = map(p);

        // Accumulate glow based on proximity to fractal edges
        glow += 0.01 / (0.02 + abs(d));

        if(abs(d) < 0.001 || t_dist > 20.0) break;
        t_dist += d * 0.6; // Step slower for better transparency/detail
    }

    // 4. Shading & Coloring
    vec3 col = vec3(0.0);

    if(t_dist < 20.0) {
        vec3 p = ro + rd * t_dist;
        vec3 nor = getNormal(p);
        vec3 viewDir = -rd;

        // Fresnel effect for "Ghostly Tech" look
        float fresnel = pow(1.0 - max(dot(nor, viewDir), 0.0), 3.0);

        // Interior "Circuit" texture
        float circuits = smoothstep(0.4, 0.5, sin(p.x * 20.0) * sin(p.y * 20.0) * sin(p.z * 20.0));

        // Cyan/Blue tech palette
        vec3 techColor = mix(vec4(0.1, 0.4, 0.8, 1.0).rgb, vec4(0.0, 1.0, 0.9, 1.0).rgb, circuits);

        col = techColor * fresnel * 2.0;
        col += techColor * circuits * 0.5;

        // Add fake refraction hint
        vec3 ref = reflect(rd, nor);
        col += texture(iChannel0, ref.xy).rgb * 0.2;

        transparency = 0.8;
    }

    // Add Volumetric Glow
    vec3 glowCol = vec3(0.1, 0.5, 1.0) * glow * u_glow_intensity * 0.05;
    col += glowCol;

    // Background - Dark Grid
    if (t_dist >= 20.0) {
        vec2 grid = abs(fract(uv * 10.0 - 0.5) - 0.5) / fwidth(uv * 10.0);
        float line = 1.0 - min(grid.x, grid.y);
        col = vec3(0.02, 0.04, 0.08) + line * 0.02;
    }

    // Depth fog
    col = mix(col, vec3(0.0, 0.01, 0.03), 1.0 - exp(-0.1 * t_dist));

    // Post-processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    fragColor = vec4(col, 1.0);
}
